import React from 'react';
import Tilt from 'react-tilt'
import NST from './NST.png'
import './Logo.css'

const Logo = () => {
  return (
    <div className='ma4 mt0 center ba'>
    <Tilt className="Tilt br2 shadow-2 ba" options={{ max : 60 }} style={{ height: 150, width: 150 }} >
      <div className="Tilt-inner pa3 ba"> <img src={NST} alt='Brush'/> </div>
    </Tilt>
    </div>
  );
}

export default Logo;
